def _try_convert_to_date(self, data):
    if not len(data):
        return data, False

    new_data = data
    if is_list_like(new_data) and not is_scalar(new_data) and new_data.dtype == "object":
        try:
            new_data = astype_nansafe(new_data, dtype="int64", copy=True)
        except (TypeError, ValueError, OverflowError):
            pass

    if is_numeric_dtype(new_data):
        min_stamp = nanmin(new_data)
        max_stamp = nanmax(new_data)
        in_range = (isna(new_data) | (min_stamp > self.min_stamp) | (new_data == iNaT))
        if not in_range.all():
            return data, False

    date_units = (self.date_unit,) if self.date_unit else self._STAMP_UNITS
    for date_unit in date_units:
        try:
            new_data = to_datetime(new_data, errors="raise", unit=date_unit)
            return new_data, True
        except (ValueError, OverflowError):
            pass

    return data, False
